import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import { Parallax, ParallaxBanner } from 'react-scroll-parallax';



function MainSlider() {
  return (
      <div className="slider">
        <Carousel

        >
          <Carousel.Item>
          <ParallaxBanner
          className="slide_img"
            layers={[
                {
                    image: '/images/slides/slide_1.png',
                    amount: 0.65,
                },
            ]}

            style={{
                textAlign: 'center',
            }}

          >
  <h1
  style={{
      textAlign: 'center',
  }}>Georgia's #1 Family Owned Pawn Shop</h1>
</ParallaxBanner>
          </Carousel.Item>


          <Carousel.Item>
          <ParallaxBanner
          className="slide_img"
            layers={[
                {
                    image: '/images/slides/slide_1.png',
                    amount: 0.65,
                },
            ]}
            style={{
                textAlign: 'center',
                margin: '0',
            }}
          >
          <h1
          style={{
              textAlign: 'center',
          }}>Georgia's #1 Family Owned Pawn Shop</h1>
        </ParallaxBanner>
          </Carousel.Item>


          <Carousel.Item>
          <ParallaxBanner
          className="slide_img"
            layers={[
                {
                    image: '/images/slides/slide_1.png',
                    amount: 0.65,
                },
            ]}
            style={{
                textAlign: 'center',
                margin: '0',
            }}

          >
          <h1
          style={{
              textAlign: 'center',
              margin: '0',
          }}>Georgia's #1 Family Owned Pawn Shop</h1>
        </ParallaxBanner>
          </Carousel.Item>
        </Carousel>
      </div>
  );
}

export default MainSlider;
